MARS ( Multi-Purpose Aiming Reflex Sight ) by Fraser-Volpe With the IR laser similar to;
 http://www.opticsplanet.com/fraser-volpe-mars-multi-purpose-aiming-reflex-sight-red-wpic-adr.html
This optic has been with me through one deployment and shows numerous cosmetic blemishes. glass and laser are in good condition. hold zero perfectly. 1 moa dot and NVG capabilities.  Uses a AA battery.  I would take $750 or a compact 1911 to carry, preferrably a Kimber or Sig.  Text me at two48 eight 24 five 24four
